INSERT INTO ProviderService (providerID, serviceID, rating, bookingNo, unitPrice, description, availability) VALUES (2, 12, 4.7, 8, 70000, N'Dịch vụ chăm sóc trẻ em chất lượng cao với đội ngũ chuyên gia có kiến thức về phát triển trẻ em. Chúng tôi sử dụng các công cụ như đồ chơi giáo dục, sách truyện và đồ dùng cho hoạt động ngoài trời để khuyến khích sự phát triển toàn diện của trẻ. Mục tiêu của chúng tôi là đảm bảo sự hạnh phúc và an lành cho trẻ trong quá trình chăm sóc.', 1);
