INSERT INTO ProviderService (providerID, serviceID, rating, bookingNo, unitPrice, description, availability) VALUES (22, 12, 4.9, 1, 85000, N'Dịch vụ chăm sóc trẻ em đáng tin cậy với giá cả phải chăng. Chúng tôi có đội ngũ chuyên gia giàu kinh nghiệm và yêu trẻ. Chúng tôi sử dụng các công cụ như trò chơi trí tuệ, nhạc cụ và hoạt động thể chất để khuyến khích sự phát triển toàn diện của trẻ. Mục tiêu của chúng tôi là tạo ra một môi trường học tập và vui chơi cho trẻ em.', 1);
